import './App.css';
import React from 'react';
import Navbar from './components/Navbar';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <>
    <Router>
    <Navbar />
    <Routes>
    <Route path="/" />
    </Routes>

    </Router>
    </>
  );
}

export default App;
